import Header from './Header';
import Footer from './Footer';
import Nav from './Nav';
import Home from './Home';
import NewPost from './NewPost';
import Postpage from './Postpage';
import About from  './About';
import Missing from './Missing';
import React from 'react';
import {Switch} from 'react-switch';
import { Route } from 'react-router-dom';
function App() {
    return (
        <div className="App">
            <Header />
            <Nav />
            <Switch>
                <Route exact path='/'>
                    <Home/>
                </Route>
            </Switch>
            <Switch>
                <Route exact path='/'>
                    <NewPost/>
                </Route>
            </Switch>
            <Switch>
                <Route exact path='/'>
                    <Postpage/>
                </Route>
            </Switch> 
            <Switch>
                <Route exact path='/'>
                    <About/>
                </Route>
            </Switch>
            <Switch>
                <Route>
                    <Missing/>
                </Route>
            </Switch>
            <Footer/>

        </div>
    );
}

export default App;
